/* eslint-disable jsx-a11y/anchor-is-valid */
import React, { Component } from 'react';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faMoon, faSun } from "@fortawesome/free-solid-svg-icons";
import './RightSide.css';
import './SortIcon';
import './SortIcon.css';

class RightSide extends Component {
    render() {
        return (
            <div className="right_side">
                <div className="container">
                    {/* NavBar */}
                    <nav className="navbar">
                        <div className="today_week">
                            <h3><a href="#">Today</a></h3>
                            <h3><a className="active" href="#">Week</a></h3>
                        </div>

                        <div className="mode_celsius">
                            <div className="white_mode"><FontAwesomeIcon icon={faMoon}/></div>
                            <div className="celsius active"><b>Â°C</b></div>
                        </div>
                    </nav>
                    {/* NavBar */}
                </div>

                {/* 7 Days Forecast */}
                <div className="container">
                    <div className="days_forecast">
                        <div className="day_weather">
                            <h5 className="day">Sunday</h5>
                            <div className="weather_icon"><FontAwesomeIcon icon={faSun}/></div>
                        </div>
                    </div>
                </div>
                {/* 7 Days Forecast */}
            </div>
        )
    }
}

export default RightSide;
